import{_ as a,o as e,c as t,a as i}from"./index-ab53618b.js";const o={},n={class:"about"},d=i("<div data-v-26f738d8><h3 data-v-26f738d8>Typowanie</h3><p data-v-26f738d8>Każdy uczestnik przed wyborami typuje, ile procent głosów zdobędzie każda z głównych partii.</p><h3 data-v-26f738d8>Punktacja</h3><p data-v-26f738d8>Uczestnicy zdobywają punkty w zależności od tego, jak blisko ich typowanie było do rzeczywistego wyniku. Można przyjąć, że za każdy 0,1 procenta błędu uczestnik traci 1 punkt. Czyli, jeżeli rzeczywisty wynik to 20% a typowanie to 22%, uczestnik zdobywa 80 punktów (100 - 20).</p><h3 data-v-26f738d8>Suma Punktów</h3><p data-v-26f738d8>Wygrywa osoba, która po zsumowaniu punktów za wszystkie partii, ma ich najwięcej.</p><h3 data-v-26f738d8>Nagroda</h3><p data-v-26f738d8>1 miejsce: 70% puli 2 miejsce: 30% puli Jeśli udział weźmie mniej niż 4 osoby, wygrany zgarnia 100% puli.</p><h3 data-v-26f738d8>Termin</h3><p data-v-26f738d8>Wszystkie typowania muszą być zgłoszone przed zamknięciem lokali wyborczych w dniu wyborów i nie mogą być zmieniane po tym terminie.</p><h3 data-v-26f738d8>Transparentność</h3><p data-v-26f738d8>Po ogłoszeniu wyników, wszystkie typowania i zdobyte punkty są ujawniane wszystkim uczestnikom.</p></div>",1),s=[d];function c(p,y){return e(),t("div",n,s)}const w=a(o,[["render",c],["__scopeId","data-v-26f738d8"]]);export{w as default};
